'use strict';

var p2pt = require('./p2pt.js');
var wrtc = require('@koush/wrtc');
require('bittorrent-tracker/lib/client/websocket-tracker.js');
require('events');
require('simple-sha1');
require('debug');

class P2PT extends p2pt {
    _wrtc;
    /**
     *
     * @param array announceURLs List of announce tracker URLs
     * @param string identifierString Identifier used to discover peers in the network
     */
    constructor(announceURLs = [], identifierString = '', peerId) {
        super(announceURLs, identifierString, peerId);
        this._wrtc = wrtc;
    }
}

module.exports = P2PT;
